defaults
  maxconn 20000
  mode    tcp
  option  dontlognull
  retries 3
  timeout http-request 10s
  timeout http-keep-alive 2s
  timeout queue 5s
  timeout tunnel 2m
  timeout client-fin 1s
  timeout server-fin 1s

frontend stats
    mode http
    bind *:8404
    stats enable
    stats uri /stats
    stats refresh 10s

frontend api
  bind :::6443 v4v6
  default_backend api

frontend api_check
  bind :8081
  mode http
  monitor-uri /check_api
  acl api_backend_dead nbsrv(api) lt 1
  monitor fail if api_backend_dead

backend api
  option httpchk GET /readyz HTTP/1.0
  option log-health-checks
  #balance roundrobin
  balance leastconn
  server node-172.16.0.10 172.16.0.10:6443 check check-ssl inter 1s fall 2 rise 3 verify none
